import Square from './Square'

import "./css/Squares.css"
const HEIGHT_IN_SQUARES = 11;

const SquaresPage = () => {

  const onClick = ()=> console.log("clicked")

  return (
    <div id="squares-container" style= {{gridTemplateRows: `repeat(${HEIGHT_IN_SQUARES}, 300px)`, gridTemplateColumns: `repeat(${HEIGHT_IN_SQUARES}, 300px)`}}>
      {[...Array(HEIGHT_IN_SQUARES**2)].map((e, i) => <Square text={i} key={i}></Square>)}
    </div>
  )
}

export default SquaresPage
